<!DOCTYPE html>
<html lang="en-us">
<head>
    <title>NEW PAGE</title>
    <meta name="referrer" content="always">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
    <script>
        const supportsAsyncFunctions = (() => { try { new Function('async () => {}')(); } catch (error) { return false; } return true; })();
        if (supportsAsyncFunctions) {
            (function (w, d, e, t, u, j, n, o, f, i) {
                document.addEventListener(e,
                    function (event) {
                        w.visitorIdObject = n;
                        w[n] = {};
                        i = d.createElement(t);
                        i.async = 1;
                        i.src = u + j;
                        d.head.appendChild(i);
                        i.onload = async function () {
                            await w[n].visitorId(u, o, f);
                        };
                    });
            })(window, document, 'DOMContentLoaded', 'script', '//visitor-identification.net', '/track.js', 'visid', { afid: '00000000-0000-0000-0000-000000000001', tpid: '', rsid: {} });
        }
        else {
            (function (w, d, e, t, u, j, n, o, f, i) {
                document.addEventListener(e,
                    function (event) {
                        w.visitorIdObject = n;
                        w[n] = {};
                        i = d.createElement(t);
                        i.id = "visIdTag";
                        i.setAttribute("u", u);
                        i.setAttribute("o", JSON.stringify(o));
                        i.setAttribute("f", f);
                        i.async = 1;
                        i.src = u + j;
                        d.head.appendChild(i);
                    });
            })(window, document, 'DOMContentLoaded', 'script', '//visitor-identification.net', '/track-compat.js', 'visid', { afid: '00000000-0000-0000-0000-000000000001', tpid: '', rsid: {} });
        }
    </script>
</head>

    <div id="aid"></div>
</body>
</html>
